body:
**Describe the bug**
I use onnxruntime-web wasm and webgl backend to do inference, the results calculated with webgl backend are far away from the correct answer. It seems that the errors in the middle accumulate continuously, resulting in a large error in the end. I check the the operations supported by webgl, choose an appropriate opset-version when export from pytorch, but the problem remains. 

**Urgency**
none

**System information**
- OS Platform and Distribution: export from Linux Ubuntu.
- ONNX Runtime installed from (source or binary): use html script, [link](https://cdn.jsdelivr.net/npm/onnxruntime-web@1.11.0-dev.20220220-4d3cd2f68/dist/ort.min.js) 
- ONNX Runtime version: 1.11.0
- Python version:  python 3.8.12, pytorch version 1.10.0
- GPU model and memory: GTX1060, 6GB

**To Reproduce**
```
const size = 256;
const session = await ort.InferenceSession.create(`model.onnx`,
    {
        executionProviders: ['webgl'] // wasm backend works.
    }
);
console.log(session.inputNames, session.outputNames);
let input = new Float32Array(size*size*3); // all zeros input as example
input = new ort.Tensor('float32', input, [1, 3, size, size])
// prepare feeds. use model input names as keys.
const feeds = { 'x': input };
const start = new Date();
results = await session.run(feeds);
const end = new Date();
console.log(`use ${end - start} ms`)
// read from results
const data = results['output'].data;
document.write(`data of result tensor 'c': ${data}\n`);
```

**Expected behavior**
Using the wasm backend, the results are as expected.  When using webgl, the results did not meet expectations

**Screenshots**
webgl output tensor: 
0.02897772192955017, 1.6782779693603516, 1.882237195968628, 1.8268663883209229, 1.8147621154785156...
wasm output tensor: 
0.001017257571220398, -0.026991114020347595, -0.030308634042739868, -0.029864490032196045, -0.029952868819236755...
**Additional context**
use opset version 14 when export. (also tried other version)
torch.onnx.export(model, input, "model.onnx", verbose=True, opset_version=14, output_names=['output'])
[onnx_model.zip](https://github.com/microsoft/onnxruntime/files/8139535/onnx_model.zip)

**Describe the bug**
Before onnx1.11.0, op shape inference output empty dim values if it cannot be deduced to a number. With onnx1.11.0, it may may set to a symbolic unk__xx value:
```
ir_version: 6
producer_name: "tf2onnx"
producer_version: "1.6.0"
graph {
  node {
    input: "cell_stem_0/comb_iter_1/right/Relu:0"
    input: "cell_0/Pad/paddings:0"
    output: "cell_stem_1/Pad:0"
    name: "cell_stem_1/Pad"
    op_type: "Pad"
  }
  name: "tmp"
  input {
    name: "cell_stem_0/comb_iter_1/right/Relu:0"
    type {
      tensor_type {
        elem_type: 1
        shape {
          dim {
            dim_param: "unk__3566"
          }
          dim {
            dim_value: 32
          }
          dim {
            dim_value: 111
          }
          dim {
            dim_value: 111
          }
        }
      }
    }
  }
  input {
    name: "cell_0/Pad/paddings:0"
    type {
      tensor_type {
        elem_type: 7
        shape {
          dim {
            dim_value: 8
          }
        }
      }
    }
  }
  output {
    name: "cell_stem_1/Pad:0"
    type {
      tensor_type {
        elem_type: 1
        shape {
          dim {
            dim_param: "unk__0"
          }
          dim {
            dim_param: "unk__1"
          }
          dim {
            dim_param: "unk__2"
          }
          dim {
            dim_param: "unk__3"
          }
        }
      }
    }
  }
  value_info {
    name: "cell_stem_1/Pad:0"
    type {
      tensor_type {
        elem_type: 1
        shape {
          dim {
            dim_param: "unk__0"
          }
          dim {
            dim_param: "unk__1"
          }
          dim {
            dim_param: "unk__2"
          }
          dim {
            dim_param: "unk__3"
          }
        }
      }
    }
  }
}
opset_import {
  version: 11
}
```
in onnxruntime\python\tools\symbolic_shape_infer.py, its logic relays on dim value being None to do symbolic derivation. Its logic is broken with onnx1.11.0. 

For this reason, I have skipped 3 test cases (in test_symbolic_shape_infer) that will fail at: 
https://github.com/microsoft/onnxruntime/blob/master/onnxruntime/test/python/onnxruntime_test_python_symbolic_shape_infer.py

**Urgency**
It depends on whether symbolic inference is needed for inferencing and/or training. Please triage 

